import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Row, Col, Image} from 'react-bootstrap';

function App() {
  return (
    //React-boostrap
    <Container fluid>
      <Row>
        <Col>
          <Image src='https://images.pexels.com/photos/8448236/pexels-photo-8448236.jpeg' fluid></Image>
        </Col>
        <Col> My Login</Col>
      </Row>
    </Container>
  );
}

export default App;
